sys_variable_value.value:
(function execute(inputs, outputs) {
    if (inputs.status_code == 200) {

        var entries = JSON.parse(inputs.response)['total_count'];
        if (entries > 0) {
            outputs.status = 'Success';
            outputs.collaboration_list = inputs.response;
            outputs.folder_collaborators_1 = JSON.parse(inputs.response).entries;

        } else {
            outputs.status = 'Error';
            outputs.error_message = "No collaborators found for the given folder ID.";

        }
    } else {
        outputs = new BoxErrorHandler().folderErrorHandler(inputs, outputs);
    }

})(inputs, outputs);

